import ExpenseDate from "./ExpenseDate";
import "./ExpenseItems.css";
function ExpenseItems(props) {
  return (
    <div className="expense-item">
      <ExpenseDate />
      <ExpenseDetails
        amount={props.amount}
        location={props.LocationOfExpenditure}
        title={props.title}
      />
    </div>
  );
}

export default ExpenseItems;
